import React from 'react';
import { Row, Col, Button } from 'react-bootstrap';
import { MdAddCircleOutline } from 'react-icons/md';

const ProductListScreen = () => (
  <>
    <Row>
      <Col>
        <h1>Title</h1>
      </Col>
      <Col>
        <Button>
          <MdAddCircleOutline size="3em" />
          Create Product
        </Button>
      </Col>
    </Row>
  </>
);

export default ProductListScreen;
